import React from 'react';
import { Image, Button, Space } from 'antd';

const TestData = {
    "other": [
        {
            "_uid": "c1ff2a8f-b369-4bd6-95ed-f7b63b7a7be5",
            "date": "2020-01-27 23:59",
            "link": "https://www.instagram.com/p/B7zhnianq8J/",
            "image": "https://res.cloudinary.com/castlery/image/upload/v1592821208/marketing/Cross-Market/instagram/ugc__tylayong.jpg",
            "content": "Obsessed with our new mirror from @castleryau. üòç‚Å† I originally placed it beside our bed, but I was experimenting (much to @benyong_'s dismay) and I styled it in our study nook (see next slide)...‚Å† I don't know which place I like it better! Can you help me decide? üòÖ",
            "disabled": false,
            "variants": "23691",
            "component": "instagram_post",
            "ig_handle": "@tylayong"
        }]
}


function ImageDemo() {
    const [random, setRandom] = React.useState();
    return (
        <Space size={12}>
            <Image
                width={200}
                src={`https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png?${random}`}
                placeholder={
                    <Image
                        src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png?x-oss-process=image/blur,r_50,s_50/quality,q_1/resize,m_mfit,h_200,w_200"
                        width={200}
                    />
                }
            />
            <Button
                type="primary"
                onClick={() => {
                    setRandom(Date.now());
                }}
            >
                Reload
            </Button>
        </Space>
    );
}

export default ImageDemo
